import React, { Component } from 'react';
import SectionHeading from './SectionHeading.js';
import SectionParagraph from './SectionParagraph.js';
import ActionButton from './btnAction.js';
import Footer from './Footer.js';

class ContactSection extends Component {
    render() {
        let para = 'Although I\'m not currently looking for any new opportunities, my inbox is always open. Whether you have a question or just want to say hi, I\'ll try my best to get back to you!'

        return(
            <div id="contactme" className="containerAG">
                <div>
                    <SectionHeading heading={'Get In Touch'}></SectionHeading>
                    <SectionParagraph para={para}></SectionParagraph>
                    <ActionButton btnCaption={'Get In Touch'}></ActionButton>
                    <p style={footer}>Andrew Gorman Â© 2020</p>
                </div>
            </div>
        )
    }
}
const container = {
    minHeight: '60em',
    position: 'relative',
    height: '100vh',
    width: '100%',
    display: 'block',
}

const content = {
    display: 'table-cell',
    width: '100%',
    height: '100vh',
    verticalAlign: 'middle'
}

const footer = {
    fontFamily: 'monospace',
    position: 'absolute',
    bottom: '0',
    width: '100%',
    paddingBottom: '30px',
    textAlign: 'center'
}


export default ContactSection;
